import "./App.css";
import { Typography, TextField, Button } from "@mui/material";
function App() {
  return (
    <div className="App">
      <Typography>This is a typography text</Typography>
      <Button>This is a button</Button>
      <TextField label="This is a text field" />
    </div>
  );
}

export default App;
